--
-- Name: add_order(integer, integer, integer, timestamp without time zone); Type: PROCEDURE; Schema: public; Owner: postgres
--

CREATE PROCEDURE public.add_order(clientid integer, bathid integer, orderrentinhours integer, orderbookingdate timestamp without time zone)
    LANGUAGE plpgsql
    AS $$
DECLARE
	orderCost money := (SELECT bath_per_hour_rent FROM bath WHERE bath_id = bathID);
	-- минимальное время аренда текущей бани
	minOrderTime int := (SELECT bath_min_order_time_hours FROM bath WHERE bath_id = bathID);
	-- время открытия бани
	beginOfRentTime time := (SELECT bath_working_hours_from FROM bath WHERE bath_id = bathID);
	-- время закрытия бани
	endOfRentTime time := (SELECT bath_working_hours_to FROM bath WHERE bath_id = bathID);
BEGIN

	-- 	время аренды меньше минимального времени аренды
	IF minOrderTime > orderRentInHours THEN
	RAISE 'Минимальное количество арендуемых часов должно быть больше, чем указанное';
	END IF;
	
	-- аренда бани до её открытия - невозможна
	IF orderBookingDate::time < beginOfRentTime THEN
	RAISE 'Невозможно сделать заказ бани. Баня еще закрыта';
	END IF;
	
	-- аренда бани до после её закрытия - невозможна
	IF orderBookingDate::time + make_interval(secs=>3600*orderRentInHours) > endOfRentTime THEN
	RAISE 'Невозможно сделать заказ бани. Баня к этому времени будет закрыта';
	END IF;
	
	-- вычисление общей суммы зказа
	orderCost := orderCost * orderRentInHours;
	-- добавление заказа
END;
$$;


ALTER PROCEDURE public.add_order(clientid integer, bathid integer, orderrentinhours integer, orderbookingdate timestamp without time zone) OWNER TO postgres;

