-- Name: before_creat_payment_trigger_function(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.before_creat_payment_trigger_function() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
	rentHours int := (SELECT order_rent_in_hours FROM orders WHERE order_id = NEW.order_id);
	orderBookingDate timestamp := (SELECT order_booking_date FROM orders WHERE order_id = NEW.order_id);
BEGIN
	IF NEW.payment_type = 'Наличные' THEN
		IF NEW.payment_requisites IS NOT NULL THEN
			NEW.payment_requisites := NULL;

		END IF;
	END IF;
	
	IF current_timestamp < orderBookingDate::timestamp + make_interval(secs=>3600*rentHours) THEN
		RAISE 'Оплату можно произвести только после окончания срока аренды';
	END IF;
	
	RETURN NEW;
END;
$$;


