--

CREATE FUNCTION public.before_create_order_trigger_function() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
	endRentDate timestamp;
	beginRentDate timestamp;
	order_rent_in_hours int;
	orderID record;
BEGIN
	FOR orderID IN SELECT order_id FROM orders WHERE bath_id = NEW.bath_id AND order_status = false
	LOOP
		-- начало аренды существующего заказа
		beginRentDate := (SELECT O.order_booking_date FROM orders O WHERE order_id = orderID.order_id );
		-- кол-во часов аренды существующего заказа
		order_rent_in_hours := (SELECT O.order_rent_in_hours FROM orders O WHERE order_id = orderID.order_id );
		
-- 		1
		
		IF NEW.order_booking_date < beginRentDate AND NEW.order_booking_date + make_interval(secs=>3600*NEW.order_rent_in_hours) >  beginRentDate + make_interval(secs=>3600*order_rent_in_hours)
		THEN
			RAISE 'Дата начала бронирования пересекается с другим заказом!';
			RETURN NEW;
		END IF;
		
-- 		2
		IF NEW.order_booking_date >= beginRentDate AND NEW.order_booking_date + make_interval(secs=>3600*NEW.order_rent_in_hours) <=  beginRentDate + make_interval(secs=>3600*order_rent_in_hours)
		THEN
			RAISE 'Дата начала бронирования пересекается с другим заказом!';
			RETURN NEW;
		END IF;
		
-- 		3
		IF NEW.order_booking_date < beginRentDate AND NEW.order_booking_date + make_interval(secs=>3600*NEW.order_rent_in_hours) > beginRentDate
		THEN
			RAISE 'Дата начала бронирования пересекается с другим заказом!';
			RETURN NEW;
		END IF;	
		
-- 		4
		IF NEW.order_booking_date < beginRentDate + make_interval(secs=>3600*order_rent_in_hours) AND NEW.order_booking_date + make_interval(secs=>3600*NEW.order_rent_in_hours) >  beginRentDate + make_interval(secs=>3600*order_rent_in_hours)
		THEN
			RAISE 'Дата начала бронирования пересекается с другим заказом!';
			RETURN NEW;
		END IF;	
		

		
	END LOOP;
	RETURN NEW;
END;
$$;


